import advancersPic from "../images/advancers.png";
import carbonprintPic from "../images/carbonprint-logo.png";
import civildiscordPic from "../images/civil-discord.png";
import flippoPic from "../images/flippo.png";
import ysePic from "../images/yse-light.png";
import shewhocodesPic from "../images/shewhocodes-light.png";

export const advancers = {
  banner: advancersPic,
  name: "Advancers.ai",
  animate: "fade-right",
};

export const carbonprint = {
  banner: carbonprintPic,
  name: "Carbonprint",
  animate: "fade-right",
};

export const civildiscord = {
  banner: civildiscordPic,
  name: "Civil Discord",
  animate: "fade-right",
};

export const flippo = {
  banner: flippoPic,
  name: "Flippopotamus",
  animate: "fade-right",
};

export const yse = {
  banner: ysePic,
  name: "Youth Society for Education",
  animate: "fade-right",
};

export const shewhocodes = {
  banner: shewhocodesPic,
  name: "She Who Codes",
};
